import React from 'react'
import { Link } from 'react-router-dom'
import Header from '../components/Header.js'
import Job_item from '../components/Job_item.js'

const Jobs = [{
    "id": 1,
    "title": "Health Coach I",
    "description": "mauris enim leo rhoncus sed vestibulum sit amet cursus id turpis integer aliquet massa id lobortis convallis tortor risus dapibus"
  }, {
    "id": 2,
    "title": "Director of Sales",
    "description": "mattis egestas metus aenean fermentum donec ut mauris eget massa tempor convallis nulla neque libero convallis"
  }, {
    "id": 3,
    "title": "Statistician III",
    "description": "eu massa donec dapibus duis at velit eu est congue elementum in hac habitasse"
  }, {
    "id": 4,
    "title": "Actuary",
    "description": "suspendisse potenti in eleifend quam a odio in hac habitasse platea dictumst maecenas ut massa quis"
  }, {
    "id": 5,
    "title": "Technical Writer",
    "description": "rutrum at lorem integer tincidunt ante vel ipsum praesent blandit lacinia erat vestibulum sed magna at nunc commodo"
  }, {
    "id": 6,
    "title": "Chemical Engineer",
    "description": "pharetra magna ac consequat metus sapien ut nunc vestibulum ante ipsum primis"
  }, {
    "id": 7,
    "title": "Recruiter",
    "description": "tortor id nulla ultrices aliquet maecenas leo odio condimentum id luctus nec molestie"
  }, {
    "id": 8,
    "title": "Administrative Assistant IV",
    "description": "dictumst etiam faucibus cursus urna ut tellus nulla ut erat id mauris vulputate"
  }, {
    "id": 9,
    "title": "Community Outreach Specialist",
    "description": "maecenas tristique est et tempus semper est quam pharetra magna ac consequat metus"
  }, {
    "id": 10,
    "title": "Administrative Assistant III",
    "description": "vivamus vel nulla eget eros elementum pellentesque quisque porta volutpat erat quisque erat eros viverra eget congue eget"
  }]


function Main_freelancer() {
    return (
        <div id="Main_freelancer">
            <Header />
            <div className="switcher container2">
                <div className="switcher-box">
                    <div className="switcher-item">
                        <Link to="/main/freelancer">Freelancer</Link>
                    </div>
                    <div className="switcher-item">
                        <Link to="/main/hirer" id="nonactive">Hirer</Link>
                    </div>
                    <div id="switcher-active"></div>
                </div>
            </div>
            <nav className="content-nav container2">
                <Link to="/main/freelancer/jobs" className="nav-link active">Jobs</Link>
                <Link to="/main/freelancer/browse" className="nav-link">Browse job</Link>
                <Link to="/main/freelancer/requests" className="nav-link">Requests</Link>
            </nav>
            <div className="content content-jobs container2">

            </div>
        </div>
    );
}

export default Main_freelancer;
